import * as React from 'react';
import {
  View,
  Text,
  KeyboardAvoidingView
} from 'react-native';

const HomeScreen: React.FC<{}> = () => {

  return (
    <KeyboardAvoidingView>
      <View style={{flex: 1}}>
        <Text style={{color: "black"}}>Hello, world</Text>
      </View>
    </KeyboardAvoidingView>
  )
}

export default HomeScreen;
